    false,nt"url": null,nt"notes": "Integrated Ocean and Coastal Mapping Product
    (IOCM). The images were acquired from a nominal altitude of 7,500 feet above ground
    level (AGL), using an Applanix Digital Sensor System (DSS). Imagery products are
    true color (RGB) and infrared (IR) images. The IR images were acquired with a 850
    nm cut on filter. Images have been orthorectified and mosaiced to produce a seamless
    data set. For information about combining the IR image and the RGB image into a
    4 band NIR image, please download the IOCM Band Stack Guide document at this link:
    ftp://www.csc.noaa.gov/temp/metadata_supp",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
